Storyline

The Quileutes close in on expecting parents Edward and Bella, whose unborn child poses a threat to the Wolf Pack and the towns people of Forks.

Cast: Andrea Powell, Peter Facinelli, Gil Birmingham, Billy Burke, Christian Camargo, Dakota Fanning, Noel Fisher, Christopher Heyerdahl, Anna Kendrick, Sebastiao Lemos and others

